import TabPanel from './TabPanel';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <p>
          Myra Dotzel
        </p>
      </header>
      <div>
        <TabPanel></TabPanel>
      </div>
    </div>
  );
}

export default App;
